import { Navbar, Tabs, Tab } from 'react-bootstrap';
import './projectnavbar.css';
import Dashboard from '../dashboard/dashboard';
function ProjectNavBar() {
    const auth = localStorage.getItem("user");
   
    return (
        <div className='projectNavBarMainDiv'>

            <Tabs className='projectNavBarMainTab' defaultActiveKey="Dashboard">
                
               {  auth.role=="manager"?<Tab className='projectNavBarItem' title="Overview" eventKey="project"></Tab>:<Tab className='projectNavBarItem' title="Overview" eventKey="Overview"></Tab> }
                <Tab className='projectNavBarItem' title="Overview" eventKey="Overview"></Tab>
                <Tab className='projectNavBarItem' title="List" eventKey="List"></Tab>
                <Tab className='projectNavBarItem' title="Timeline" eventKey="Timeline"></Tab>
                <Tab className='projectNavBarItem' title="Calendar" eventKey="Calendar"></Tab>
                <Tab className='projectNavBarItem' title="Dashboard" eventKey="Dashboard"><Dashboard></Dashboard></Tab>
                <Tab className='projectNavBarItem' title="More" eventKey="More"></Tab>
            </Tabs>
        </div>
    );
}

export default ProjectNavBar;
